import { navigate, Link } from '@reach/router';
import axios from 'axios';
import React from 'react';

const PetList = props => {

    const clickHandler = pet => {
        navigate(`/${pet._id}`)
        // console.log(pet)
    }
    const deletePet = pet => {
        axios.delete(`http://localhost:8000/api/pets/${pet._id}`)
            .then(res=>{
                props.removeFromDom(pet)
            })
    }

    return(
        <div className="body">
        <div className="header">
            <h1>Pet Shelter</h1>
            <Link to="/pets/new">add a pet to the shelter</Link>
        </div>
        <div className="content">
            <h3>These pets are looking for a good home</h3>
        </div>
        {/* {console.log(props.pets)} */}
        {props.pets.map((pet, i)=>{
            return <>
            <p onClick={e=>clickHandler(pet)} key={i}>{pet.name}</p>
            <button onClick={e=>{deletePet(pet)}}>Delete</button>
            </>
        })}
        </div>
    )
}
export default PetList;
